export const dummyStock = [
  {
    id: 1,
    productId: 1,
    change: +20,
    date: "2025-12-01",
    note: "New stock added"
  },
  {
    id: 2,
    productId: 2,
    change: -10,
    date: "2025-12-02",
    note: "Used in manufacturing"
  }
];
